import React, { Component } from 'react'

export default class A extends Component {
    render() {
        return (
            <div>
                <h3>我是A组件</h3>
                <h4>我的用户名是：{this.sta}</h4>
            </div>
        )
    }
}

class B extends Component {
  render() {
    return <div></div>
  }
}

class C extends Component {
  render() {
    return <div></div>
  }
}
